    false,nt"url": null,nt"notes": "This annual narrative report for Hamden
    Slough National Wildlife Refuge summarizes refuge activities during the 1993 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition - including fee titles and easements topics are also
    covered.  The report includes a planning section which discusses refuge management
    plans and research.  Refuge administration is outlined; information about personnel,
    refuge programs, funding and safety is given.  Habitat management is also covered.
     Subjects include wetlands, grasslands, and weed control.  The wildlife section
    of the report discusses wildlife diversity, endangered or threatened species, and
    game mammals.  The public uses of the refuge described in this report include interpretive
    programs, hunting, and law enforcement.  The equipment and facilities section of
    the report provides information about new construction, maintenance, and computer
    systems.  Items of interest are provided at the end.",nt"license_title": "License
